import './App.css';
import React, { useState, useEffect } from "react";
// import {Button} from '@material-ui/core'; //importing material ui component
// import { styled } from '@mui/material/styles';
// import Box from '@mui/material/Box';
// import Paper from '@mui/material/Paper';
// import Grid from '@mui/material/Unstable_Grid2';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Unstable_Grid2';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';


const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: '#fafafa',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  margin: theme.spacing(4),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

const StyledInput = styled(TextField)(({ theme }) => ({
  // backgroundColor: '#fafafa',
  // ...theme.typography.body2,
  // padding: theme.spacing(1),
  margin: theme.spacing(1),
  // textAlign: 'center',
  // color: theme.palette.text.secondary,
}));

const StyledButton = styled(Button)(({ theme }) => ({
  // backgroundColor: '#fafafa',
  // ...theme.typography.body2,
  margin: theme.spacing(1),
  // textAlign: 'center',
  // color: theme.palette.text.secondary,
}));


export default function App() {
  const [inputValue, setInputValue] = React.useState("");

  const onChangeHandler = event => {
    console.log(event)
    setInputValue(event.target.value);
  };
  const onClickHandler = event => {
    console.log(event)
    // setInputValue(event.target.value);
  };

  const PrettyPrintJson = ({ data }) => (<div><pre>{
    JSON.stringify(data, null, 2)}</pre></div>);
  const [algorithmsResponse, setAlgorithmsResponse] = useState([]);

  useEffect(() => {
    fetch(`http://algorithms-server:3001/api/scrape/runAlgorithms/b39659d6-2a74-429d-a985-a9ad59a6bc62`,
      {
        method: "GET",
        headers: new Headers({
          Accept: "application/vnd.github.cloak-preview"
        })
      }
    )
      .then(res => res.json())
      .then(response => {
        // setCommitHistory(response.items);
        // setIsLoading(false);
      })
      .catch(error => console.log(error));
  }, []);

  return (
    <Box sx={{ flexGrow: 1 }}>

      <Grid container spacing={2}>

        <Grid xs={4}>
          <Item>
            <StyledInput size={'small'} onChange={onChangeHandler} id="outlined-basic" label="Scrape ID" variant="outlined" />
            <StyledButton size={'small'} onClick={onClickHandler} variant="outlined">Run Algorithms</StyledButton>
          </Item>
        </Grid>
        <Grid xs={8}>
          <Item>
            <PrettyPrintJson data={`
          {
            "totalResults": {
                "AMS": {
                    "1.) Dividend Rate Comparison": {
                        "Trailing Annual Dividend Rate": 0,
                        "Forward Annual Dividend Rate": 0,
                        "currentMarketValue": 2.85,
                        "description": "Trailing Annual Dividend Rate === Forward Annual Dividend Rate",
                        "estimatedStockPrice": "N/A",
                        "weight": -1
                    },
                    "2.) Peg Ratio and EPS": {
                        "Quarterly Revenue Growth (yoy)": 0.17800000000000002,
                        "PE Ratio (TTM)": 0.19,
                        "Dividend Payout Ratio": 1.0674157303370786,
                        "PEG Ratio": 1.0674157303370786,
                        "currentMarketValue": 2.85,
                        "description": "PEG Ratio > .5 and Dividend Payout Ratio > .5",
                        "estimatedStockPrice": 2.85,
                        "weight": 1
                    },
                    "3.) Beta Swings": {
                        "currentMarketValue": 2.85,
                        "description": "1 > Possible Correction > -1",
                        "estimatedStockPrice": 2.842115475,
                        "weight": 0
                    },
                    "4.) 52 Week Low and Highs & Volume": {
                        "currentMarketValue": "N/A",
                        "estimatedStockPrice": "N/A",
                        "weight": 0,
                        "sAndPFiveHundredFiftyTwoWeekChange": -0.139,
                        "fiftyTwoWeekChange": 0.1585,
                        "previousClose": 2.85,
                        "description": "Missing fiftyTwoWeekLow AND fiftyTwoWeekHigh AND averageVolume"
                    },
                    "5.) Moving Average Mean Reversions": {
                        "currentMarketValue": "N/A",
                        "estimatedStockPrice": "N/A",
                        "weight": 0,
                        "previousClose": 2.85,
                        "description": "Missing fiftyDayAverage AND twoHundredDayAverage AND averageVolume"
                    },
                    "6.) Stock Movement Seven Days": {
                        "closingHistories": [
                            2.78,
                            2.85,
                            2.81,
                            2.84
                        ],
                        "currentMarketValue": 2.85,
                        "description": "No Trend In Stock Movement",
                        "estimatedStockPrice": "N/A",
                        "weight": 0
                    },
                    "7.) % of Shares Short": {
                        "currentMarketValue": 2.85,
                        "description": "(Short % of Shares Outstanding) < 5% ",
                        "estimatedStockPrice": 2.8500228,
                        "weight": 1.000008
                    },
                    "8.) Revenue Growth": {
                        "currentMarketValue": "N/A",
                        "estimatedStockPrice": "N/A",
                        "weight": 0,
                        "previousClose": 2.85,
                        "description": "Missing revenueGrowth"
                    },
                    "9.) Earnings Growth": {
                        "currentMarketValue": "N/A",
                        "estimatedStockPrice": "N/A",
                        "weight": 0,
                        "previousClose": 2.85,
                        "description": "Missing earningsGrowth"
                    },
                    "10.) Trailing P/E vs.Forward P/E": {
                        "currentMarketValue": "N/A",
                        "estimatedStockPrice": "N/A",
                        "weight": 0,
                        "dilutedEPS": 0.19,
                        "previousClose": 2.85,
                        "description": "Missing trailingPE AND forwardPE"
                    },
                    "11.) Ability to Pay Current Liabilities": {
                        "Current Assets": 15087000,
                        "Current Liabilities": 5891000,
                        "currentMarketValue": 2.85,
                        "description": "Current Assets > Current Liabilities",
                        "estimatedStockPrice": 2.85,
                        "weight": 1
                    },
                    "12.) Stock Buy Backs": {
