                        "currentMarketValue": 2.85,
                        "description": "((Previous Issued Shares) - (Current Issued Shares)) < 0",
                        "estimatedStockPrice": 2.830881871727749,
                        "weight": -1.006708115183246
                    },
                    "20.) Free CashFlow Yield PerStock": {
                        "currentMarketValue": 2.85,
                        "description": "Operating Cash Flow (ttm) < 0",
                        "estimatedStockPrice": 2.85,
                        "weight": -1
